Match a nested object field present in an array in lookup aggregation<p>I have two collections <code>Projects</code> and <code>Users</code>.</p>
<p><code>Projects</code> has a budget field with the following: 1)<code>amount</code> and 2)<code>currency</code></p>
<pre><code>{
  _id: ObjectId(...),
  type: 'typeA',
  budget: {
    amount: 123,
    currency: 'USD'
  }
}
</code></pre>
<p><code>Users</code> has a field called <code>bids</code> which contains list of objects with fields <code>amount</code> and <code>currency</code>.</p>
<pre><code>{
  _id: ObjectId(...),
  name: &quot;User name&quot;,
  bids: [{amount: 123, currency: &quot;USD&quot;}, {amount: 342, currency: &quot;INR&quot;}]
}
</code></pre>
<p>I am trying to join <code>Users</code> with <code>Projects</code> using a lookup aggregation.</p>
<pre><code>db.Projects.aggregate([
    {
        $lookup: {
          from: &quot;Users&quot;,
          let: { projectAmount: &quot;$budget.amount&quot;, projectCurrency: &quot;$budget.currency&quot; },
          pipeline: [
            {$match: {
              $expr: {
                $and: [
                   { $eq: [&quot;$bids.amount&quot;,   &quot;$$projectAmount&quot;] },
                   { $eq: [&quot;$bids.currency&quot;, &quot;$$projectCurrency&quot;] }
                ]
              }
            }}
          ],
          as: &quot;matchingBids&quot;
    }
]);
</code></pre>
<p>But I am always getting the empty result though I have some matching objects in the Users collection. I've gone through the official docs and internet but didn't find anything helpful. Any help would be appreciated. Thank you</p>

