How to use $toLower and $trim aggregation operators using MongoDB Java?<p>I have a collection called Users, which contains an array called skills.</p>
<p>I use the following code to unwind the skills array and count the number of documents associated with each skill:</p>
<pre><code>Bson uw = unwind(&quot;$skills&quot;);
Bson sbc = sortByCount(&quot;$skills&quot;);
Bson limit = limit(10);
coll.aggregate(Arrays.asList(uw, sbc,limit)).forEach(printDocuments());
</code></pre>
<p>Now I want to make use of <strong>$trim</strong> and <strong>$toLower</strong> operations for the above aggregation because in the database, some skills saved in different ways (e.g., <strong>&quot;CSS&quot;</strong>, <strong>&quot;CSS &quot;</strong>, and <strong>&quot;css&quot;</strong>).</p>
<p>I'm able to do this in the mongo shell with the following aggregation:</p>
<pre><code>db.users.aggregate([{$unwind:&quot;$skills&quot;} , {$sortByCount:{$toLower:{$trim:{input:&quot;$skills&quot;}}}}])
</code></pre>
<p>But I'm having troubles with implementing it in Java.</p>
<p>Do you have any idea?</p>

