Login React + Express + mongoDB doesn't work properly<p>I have an issue with the login authentication in my project. I connected my react front end with my express back end, but when I try to login with valid credentials, it gets stuck in an error seems like it can't read properly the value I'm passing in my form input.</p>
<p>Here's my LogIn page:</p>
<pre><code><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>    import React, { Component } from 'react';
    import { Link } from 'react-router-dom';

    import PropTypes from 'prop-types';
    import { connect } from 'react-redux';
    import { signin } from '../actions/authAction';
    import { clearErrors } from '../actions/errAction';

    import { Button, Form, FormGroup, Input, Alert } from 'reactstrap'
    import TopCont from '../components/TopCont'

    class Signin extends Component {
        state = {
            email: '',
            password: '',
            msg: null
        };

        static propTypes = {
            isAuth: PropTypes.bool,
            signin: PropTypes.func.isRequired,
            err: PropTypes.object.isRequired,
            clearErrors: PropTypes.object.isRequired
        };

        componentDidMount(){
            this.props.clearErrors();
        }

        componentDidUpdate(prevProps){
            const { err } = this.props;

            if(err !== prevProps.err) {
                if(err.id === 'LOGIN_FAIL'){
                    this.setState({ msg: err.msg.msg });
                } else {
                    this.setState({ msg: null });
                }
            }
        };

        onChange = e =&gt; {
            this.setState({ 
                [e.target.email]: e.target.value,
                [e.target.password]: e.target.value
            });
        };

        onSubmit = e =&gt; {
            e.preventDefault();

            const { email, password } = this.state;

            const user = {
                email,
                password
            };

            this.props.signin(user);

            /* this.props.push('/dashboard'); */
        };

        render() {
            return (
            &lt;&gt;
                &lt;TopCont&gt;
                    &lt;div className="signin-cont"&gt;
                        &lt;h1&gt;Accedi&lt;/h1&gt;

                        {this.state.msg ? &lt;Alert color="danger"&gt;{this.state.msg}&lt;/Alert&gt; : null }

                        &lt;Form className="signin-form-cont" onSubmit={this.onSubmit}&gt;
                            &lt;FormGroup&gt;
                                &lt;Input className="signin-form" type="email" name="email" id="email" placeholder="mario.rossi@prova.it" onChange={this.onChange}/&gt;
                            &lt;/FormGroup&gt;

                            &lt;FormGroup&gt;
                                &lt;Input className="signin-form" type="password" name="password" id="password" placeholder="Password" onChange={this.onChange}/&gt;
                            &lt;/FormGroup&gt;

                            &lt;Button className="sign-btn"&gt;Accedi&lt;/Button&gt;
                        &lt;/Form&gt;

                        &lt;p&gt;Non hai ancora un account? &lt;Link to="/signup"&gt;Registrati&lt;/Link&gt;&lt;/p&gt;                  
                    &lt;/div&gt;
                &lt;/TopCont&gt;
            &lt;/&gt;
            )
        }
    }

    const mapStateToProps = state =&gt; ({
        isAuth: state.auth.isAuth,
        err: state.err
    });

    export default connect(mapStateToProps, { signin, clearErrors })(Signin);</code></pre>
</div>
</div>

</code></pre>
<p>Here is my Action:</p>
<pre><code><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>import axios from 'axios';
import { returnErrors } from './errAction';
import  { AUTH_ERROR, LOGIN_FAIL } from '../actions/types';

    export const signin = ({ email, password }) =&gt; dispatch =&gt; {
        const  config = {
            headers: {
                'Content-Type': 'application/json'
            }
        };

        const body = JSON.stringify({ email, password });

        axios.post('/api/auth', body, config)
            .then(res =&gt; dispatch({
                type: LOGIN_SUCCESS,
                payload: res.data
            }))
            .catch(err =&gt; {
                dispatch(returnErrors(err.response.data, err.response.status, 'LOGIN_FAIL'));
                dispatch({
                    type: LOGIN_FAIL
                });
            });
    };</code></pre>
</div>
</div>

</code></pre>
<p>And here is my Auth API:</p>
<pre><code><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>    const express = require('express');
    const router = express.Router();
    const bcrypt = require('bcryptjs');
    const config = require('config');
    const jwt = require('jsonwebtoken');
    const auth = require('../../middleware/auth');

    const User = require('../../models/User');

    //@action POST api/auth
    //@descr auth user
    //@access Public
    router.post('/', (req, res) =&gt; {
        const { email, password } = req.body

        if( !email || !password ) {
            return res.status(400).json({ msg: "Enter all fields."});
        }

        User.findOne({ email })
            .then(user =&gt; {
                if(!user) return res.status(400).json({ msg: "Nessun profilo trovato con questa email"});

                bcrypt.compare( password, user.password )
                    .then(isMatch =&gt; {
                        if(!isMatch) return res.status(400).json({ msg: "Password errata!"});

                        jwt.sign(
                            { id: user.id },
                            config.get('jwtSecret'),
                            { expiresIn: 10800 }, 
                            (err, token) =&gt; {
                                if(err) throw err;

                                res.json({
                                    token,
                                    user: {
                                        id: user.id,
                                        name: user.name,
                                        surname: user.surname,
                                        email: user.email,
                                        userPlus: user.userPlus
                                    }
                                })
                            }
                        )
                    })
            })
    });

    //@action GET api/auth/user
    //@descr GET user data
    //@access Private
    router.get('/user', auth, (req, res) =&gt; {
        User.findById(req.user.id)
            .select('-password')
            .then(user =&gt; res.json(user));
    });

    module.exports = router;</code></pre>
</div>
</div>

</code></pre>
<p>If I try to get rid of all the errors controls my server return this error:
<code>TypeError: Cannot read property 'password' of null</code></p>
<p>The strange thing is that if I try to register a new user (with an almost identical component and server-side method) there are no problems and it authenticates too with no problems.</p>
<p>Someone knows how can I fix this issue?</p>

