<p>My solution is :</p>

<pre class="lang-js prettyprint-override"><code>async findRank() {
  const users = await User.find().sort({score: -1})
  let ObjectOfResults = JSON.parse(JSON.stringify(users))
  for (let index = 0; index &lt; ObjectOfResults.length; index++) {
    ObjectOfResults[index].rank = index
  }
  return ObjectOfResults
}
</code></pre>
<p>So imagine we have very big data in here. Can I improve my solution using MongoDB operations?</p>

